import React, { useEffect } from 'react';
import './App.css';
import NFTGenerator from './components/NFTGenerator';

function App() {
  useEffect(() => {
    console.log('App component mounted');
  }, []);

  return (
    <div className="App" style={{ border: '5px solid red' }}>
      <header className="App-header" style={{ border: '3px solid yellow' }}>
        <h1>AI NFT Generator</h1>
        <p>Connect your wallet and generate unique AI-powered NFTs</p>
      </header>
      <main style={{ border: '3px solid green' }}>
        <NFTGenerator />
      </main>
    </div>
  );
}

export default App;
